  "91ff22cfdfae4000a6d9": "PCI DSS (Payment Card Industry Data Security Standard) es el estándar global de seguridad de datos para la industria de tarjetas de pago. Desarrollado por grandes organizaciones de tarjetas de crédito como Visa, MasterCard y American Express, PCI DSS tiene como objetivo proteger los datos de los titulares de tarjetas y prevenir el fraude con tarjetas de crédito, el hacking y las vulnerabilidades de seguridad.\n\nPCI DSS consta de 12 requisitos de seguridad fundamentales que abarcan la seguridad de la red, la protección de datos, la gestión de vulnerabilidades, el control de acceso, el monitoreo de la red y las políticas de seguridad de la información. Todos los comerciantes y proveedores de servicios que manejan, almacenan o transmiten información de tarjetas de crédito deben cumplir con estos estándares.\n\n{brandName} está certificado por PCI, lo que demuestra que sus medidas de seguridad de datos cumplen con estándares reconocidos internacionalmente. Esta certificación garantiza la protección efectiva de la información de tarjetas de crédito de los clientes y otros datos sensibles contra violaciones y fraudes.",
  "91xXw22xZhCYxYVeDdhx4i": "Número máximo de archivos cargados: {num}.",
  "92eq8vZsMSwqhGko8WYXAy": "Depositar",
  "93515e63f9a64000a1f4": "Seguridad DNS",
  "93KEpBLkX7fLmtuwVAmBrC": "Abandona el rango objetivo",
  "93RVzcYHsLpzdLqoXhjq1b": "<span>Soporte limitado y vulnerabilidad a errores:</span> los monederos Web3 suelen carecer de un servicio de atención al cliente específico y son propensos a errores de los usuarios, como el envío de fondos a la dirección equivocada. También suelen carecer de servicios directos de conversión de fiat a cripto.",
  "93a9284459b84000a20f": "APR máximo: {apr}",
  "93bamwKq383WFycaKTMQEd": "Las cuentas no se pueden fusionar después de eliminarse. Si quieres fusionarlas, ponte en contacto con el <a href='{a}' target='_blank' rel='noopener noreferrer'>Servicio de atención al cliente</a>.",
  "94HZ4AG61AYiY8N7PidjXH": "Cuando se opera con criptodivisas, hay que ser consciente de los riesgos sistemáticos que afectan a todo el mercado, como los cambios normativos o los grandes acontecimientos mundiales. Estos factores pueden repercutir en todas las criptos, incluidas las de tu cartera. Al replicar las estrategias de otra persona, no solo te expones a los riesgos de su toma de decisiones, sino también a estas dinámicas de mercado más amplias. Por ejemplo, un cambio normativo repentino o un problema importante con uno de las principales exchanges de criptos podría afectar en gran medida a las condiciones del mercado y repercutir en tus inversiones. Por tanto, es importante diversificar tu cartera y tus estrategias de trading para distribuir el riesgo.",
  "969274b779d14000ab7b": "Copias de seguridad y recuperación de datos",
  "96ae3df671f24000ab05": "{brandName} utiliza algoritmos de cifrado fuertes y cuidadosamente seleccionados para garantizar que todas las comunicaciones estén protegidas contra la interceptación o manipulación no autorizada de terceros. Esto incluye algoritmos de intercambio de claves que soportan la confidencialidad hacia adelante como ECDHE (Elliptic Curve Diffie-Hellman Ephemeral), y algoritmos de cifrado simétrico como AES (Advanced Encryption Standard) y ChaCha20. Estos algoritmos son reconocidos globalmente por su seguridad probada a lo largo del tiempo.\n\n{brandName} monitorea y actualiza continuamente sus medidas de seguridad para abordar las amenazas cibernéticas en evolución. Nuestras auditorías de seguridad regulares garantizan que nuestras prácticas de seguridad cumplen o superan los estándares de la industria. La seguridad de nuestros usuarios es nuestra máxima prioridad, y {brandName} está comprometido a proporcionar un entorno de trading seguro y conveniente. Tu confianza es la fuerza impulsora detrás del progreso siempre creciente de {brandName}.",
  "96oo8Yq5o389Qt4hNRmqty": "Editar orden",
  "9714bcf9f64d4000a55b": "Nuestro equipo profesional de respuesta a incidentes gestiona los problemas de seguridad 24/7, con procedimientos bien establecidos. Predecimos problemas potenciales, respondemos de inmediato y realizamos revisiones posteriores a los incidentes para garantizar respuestas de emergencia efectivas.",
  "97rDn5c8r9axPurnUZSTRp": "Aprovecha los ciclos de halving de Bitcoin con {brandName}. Tanto si compras como si vendes Bitcoin en el mercado de spot, vas en largo o en corto en Bitcoin aprovechando su volatilidad u optas por generar ingresos pasivos con tu Bitcoin inactivo, la sólida plataforma de {brandName} garantiza una experiencia de trading segura en los mercados.",
  "98acee1e18524000af2e": "{brandName} ha establecido protocolos de seguridad detallados para conexiones API, autenticación, protección de datos, validación de entrada/salida y limitación de velocidad.",
  "98hKFZudY7idarYUXkajXf": "Proof of stake de Ethereum (PoS)",
  "99b947d9491d4000a5c7": "Detección de plugins maliciosos",
  "99f11beaaa364000a3d8": "Simulación periódica de incidentes de seguridad para poner a prueba las capacidades de respuesta de todos, incluidas, entre otras, pruebas de phishing, simulacros de respuesta a incidentes y ejercicios de equipo rojo.",
  "99k7WVk3eymfiacNiM2JLv": "<span>Clave pública:</span> tu <a href='{url}' target='_blank'>clave pública</a> es similar a la dirección de tu monedero. Puedes compartirla para recibir fondos o utilizar aplicaciones descentralizadas (<a href='{dappsurl}' target='_blank'>dapps</a>). Se genera a partir de la clave privada, pero no puede revelar ni permite deducir tu <a href='{url2}' target='_blank'>clave privada</a>.",
