  "9Vg9Ye1NshSRtk2XPYyH3c": "Puedes consultar las estadísticas del pool de minería visitando su sitio web y accediendo a su panel de control. Este proporciona información sobre sus hashrates, ganancias y otros datos relevantes.",
  "9XxwPW34ksQYeK78wJEaUL": "Añadir contacto",
  "9YRzfJQkHpD1ADcF5vJd2h": "Motivo de congelación de activos pendiente. Te informaremos en breve.",
  "9b49625b13694000aa6f": "El sistema de seguridad de cuentas de {brandName} consta de dos partes: verificación y control de riesgos. Nuestro protocolo de control de riesgos implementa estrategias anti-phishing para múltiples escenarios como inicios de sesión, retiradas y para variaciones en la configuración de seguridad. Evalúa los dispositivos de los usuarios, las direcciones IP y el comportamiento pasado para evaluar los riesgos potenciales. Si se detecta un riesgo, se inician pasos de verificación adicionales basados en el escenario específico para mantener las cuentas seguras.",
  "9bb956f7b7d74000a302": "Gestión de ID de dispositivos",
  "9bedd0200f824000a39c": "{brandName} tiene una plataforma unificada para gestionar y analizar registros de operación y seguridad. Esto garantiza que todos los comportamientos y actividades se registren de forma inmutable para cumplir con los requisitos reglamentarios, permitir la monitorización, respaldar las investigaciones y garantizar la trazabilidad.",
