  "9fbb6d6647c74000a565": "2. Puedes desactivar la suscripción automática y rescatar tus productos comprados en cualquier momento.",
  "9hK2i7qu9ucJ4grAZRAByv": "<span>Ten en cuenta la ubicación y la latencia:</span> opta por un pool con baja latencia y mayor proximidad geográfica para una mejor eficiencia minera.",
