  "9r6dNa5PHiS643bYDiZV4m": "Tu puerta de entrada a DeFi, dapps y NFT",
  "9vJtKFry8Q1xpq2TjbPG4x": "Depender únicamente de los traders copiados para tus inversiones en criptos puede ser arriesgado. Por un lado, es posible que sus estrategias no se alineen con tu tolerancia al riesgo y tus objetivos. Algunos también pueden tener incentivos (como ventajas o comisiones de trading más bajas) que los lleven a priorizar la obtención de seguidores sobre las prácticas de trading sostenibles a largo plazo que se adapten a tus metas financieras.",
  "9vZMJ91Rea72iuDjqm7zrD": "Órdenes TWAP",
  "9ybg8nNsJNUCDkcPwV8ncf": "Crear un monedero Web3 es un proceso sencillo. Aquí tienes una guía paso a paso para ayudarte a crear tu propio monedero Web3:",
