  "KuCard": "KuCard",
  "a34084aa796d4000af37": "Cuenta de margen aislado de alta frecuencia",
  "a3ad8ebe7d904000af8e": "Cuando los usuarios crean una API o acceden a la página de gestión de API, las retiradas solo pueden realizarse desde la dirección IP del usuario y las direcciones de retirada especificadas. Esto reduce con eficacia el riesgo de brechas de seguridad en caso de que se filtre o se pierda una clave de API.",
  "a4HWeqMA3NNtUsRPtDwQov": "Si el precio de {coin1} es igual o inferior a {protectPrice}, recibirás {num} {coin1}.",
  "a5dd634a700a4000ae11": "Primer artículo",
  "a5tsFk78WLBMjP7PL518CL": "Impuestos",
  "a6QD5WPJNKRezS4vxBbsHb": "Red de depósito:",
  "a775e0c384f34000a3a8": "{brandName} implementa la segregación de permisos para los KPI de los usuarios, incluidos los permisos generales, de trading de spot, de márgenes y de futuros. Los diferentes niveles de permisos corresponden a diferentes operaciones, lo que evita las acciones de permisos cruzados. Para cambiar los permisos, los usuarios primero deben iniciar sesión en sus cuentas, lo que garantiza la seguridad de sus fondos.",
  "a7P3fAoqk4dH8uaFvzj6Kq": "Mín.: {rate}",
  "a840f10cc4cf4000a46e": "Claves de API y segregación de cuentas",
  "a8TpUFNDSYShm4cRjT5y1b": "Más información",
  "a8c95b5ee1ea4000aebf": "Proteger la privacidad de los datos de los usuarios es nuestra máxima prioridad. {brandName} emplea medidas de seguridad avanzadas para garantizar la confidencialidad de los datos y prevenir el acceso no autorizado. Los datos sensibles, incluyendo contraseñas, claves de transacción e información de identificación personal, están protegidos utilizando las medidas más estrictas. Estos datos se procesan con métodos de prueba de conocimiento cero, asegurando que incluso la plataforma no puede acceder a esta información sin la autorización explícita del usuario. Además, todos los datos sensibles se cifran utilizando algoritmos de cifrado avanzados para mejorar aún más la seguridad.\n\nLa plataforma utiliza sistemas de bases de datos especialmente diseñados y dedicados para almacenar información sensible, proporcionando una capa adicional de seguridad. Como tal, estas bases de datos operan en entornos de red interna estrictamente controlados. Los métodos de contenerización aseguran entonces que cada servicio se ejecuta en un contenedor separado, manteniendo los servicios aparte con un nivel de aislamiento. Este enfoque garantiza que incluso dentro de la plataforma, los servicios no pueden acceder a los datos sensibles de forma cruzada. La seguridad de los datos realizada de esta manera mantiene así la plataforma estable y escalable.",
  "a8oyZqZr6dz72wSfrpqKCc": "Básico",
  "a9b72c3a46494000a10c": "1. Colaboramos con instituciones autorizadas y agrupamos los fondos periódicamente en cuentas bancarias institucionales fiables para garantizar la seguridad de los fondos de los usuarios.\n 2. Verifica que el nombre de la cuenta del depositante coincida con la cuenta del usuario para evitar fraudes y riesgos de cumplimiento.\n 3. Verifica que el nombre de la cuenta del destinatario coincida con la cuenta del usuario para las retiradas y evita fraudes y riesgos de cumplimiento.\n 4. Todas las transacciones de depósito y retirada requieren la finalización de una verificación avanzada KYC (Conozca a su cliente).",
  "a9dae303ab5e4000a56d": "Las contraseñas y otros datos sensibles son inaccesibles sin la autorización explícita del usuario. {brandName} utiliza una autenticación estricta para todas las solicitudes internas, asegurando que solo los servicios autorizados pueden intercambiar datos. El control de acceso basado en roles (RBAC) limita el acceso a datos sensibles para operaciones necesarias, evitando que incluso los usuarios y servicios autorizados excedan sus permisos.\n\nPara mayor seguridad, realizamos regularmente auditorías de seguridad y escaneos de vulnerabilidades para asegurar que todos los sistemas cumplan con los estándares y las mejores prácticas más recientes. El equipo de seguridad de {brandName} monitorea de cerca las amenazas emergentes, respondiendo rápidamente a cualquier incidente potencial. Por último, pero no menos importante, los empleados también reciben formación regular en seguridad para mantener las mejores prácticas de seguridad diarias.\n\nComo su confianza es primordial para nosotros, {brandName} se compromete a proteger la privacidad y la seguridad de los datos del usuario. Estamos mejorando constantemente nuestras medidas de seguridad para proteger mejor contra las amenazas cibernéticas cada vez más sofisticadas. Estas medidas tienen como objetivo proporcionar un entorno de trading seguro, permitiendo a nuestros usuarios operar con confianza y seguridad.",
