  "aboutus.feature3.intro": "Estamos desarrollando un ecosistema en torno a {brandName} Token (KCS), que será tu guía hacia un próspero mundo descentralizado construido conjuntamente por todos los miembros de la comunidad {brandName}.",
  "aboutus.press": "Prensa",
  "aboutus.story": "Nuestra historia",
  "aboutus.story.intro": "Detrás de {brandName} hay dos frikis de la tecnología que fueron de los primeros en adoptar la blockchain. Michael, que empezó a programar a los 8 años y fundó su primera startup a los 16, empezó a minar BTC en cuanto su jefe, Eric, le habló de él en 2012. Pero cuando intentó vender algunos BTC en Mt. Gox, descubrió que la que era la mayor plataforma del mundo en aquel momento era difícil de usar para los principiantes. A medida que la adopción de la blockchain proseguía, Michael y Eric se dieron cuenta de que estaba remodelando el sistema financiero para que no solo sirviera a los más ricos, sino a todos los ciudadanos del mundo, incluso a los menos formados, desempleados y no bancarizados. A finales de 2013, escribieron las primeras partes del código de {brandName} en una cafetería, y comenzaron un People's Exchange que permitiría a todos involucrarse en las criptomonedas.",
