  "asset.faq.answer.one": "La Cuenta de financiación se usa para depósitos, retiradas y compras de criptomonedas a través de tarjetas de crédito/débito, así como para préstamos de margen. La Cuenta de trading, para operar con criptos. La Cuenta de márgenes, para préstamos y operaciones con margen. La Cuenta de futuros, para operar con futuros. La Cuenta financiera, para stake y gestión financiera, con un rendimiento anual de hasta el 20 %.",
  "asset.faq.answer.oneNew": "La Cuenta de financiación se usa para depósitos, retiradas y compras de criptomonedas a través de tarjetas de crédito/débito, así como para préstamos de margen. La Cuenta de trading, para operar con criptos. La Cuenta de márgenes, para préstamos y operaciones con margen. La Cuenta de futuros, para operar con futuros. La Cuenta financiera, para stake y gestión financiera, con un rendimiento anual de hasta el 20 %.",
