  "assets.por.audit.progress.content1": "En un momento determinado, todos los activos de los usuarios se capturarán, almacenarán y cifrarán. El personal de verificación se asegurará de que se incluyan todos.",
  "assets.por.audit.progress.content2": "El hash del UID y el saldo de cada usuario conforman una hoja de Merkle, mientras que la suma de todos los activos de los usuarios conforman el árbol de Merkle. <br/> Una vez generado este, se identificará cualquier modificación.",
  "assets.por.audit.progress.content3": "En el momento de la captura, las correspondientes direcciones verificables de cada tipo de activo y sus alturas de bloque.<br/>\nTambién existe un método especial para verificar la propiedad de las direcciones de los monederos.",
  "assets.por.audit.progress.content4": "Reservas en el momento de la instantánea = activos en direcciones de monedero / activos totales en el árbol de Merkle.",
