  "assets.por.audit.verify.content1": "Ten en cuenta que factores como la hora de la captura y los activos de la cuenta incorporados provocarán diferencias con los activos actuales de tu cuenta.",
  "assets.por.audit.verify.content2": "Verificación aprobada. Los activos de cada uno están almacenados y protegidos de forma segura.<br/>\nComo todos pueden participar en la verificación, se puede confiar en la cantidad total de activos de usuarios en la plataforma.",
