  "assets.withdraw.fees": "Comisión",
  "assetsBack.cs.airCoin.applyDes": "Revisa los detalles de tu solicitud. Una vez aprobada, te notificaremos la comisión de servicio aplicable, que se deducirá de tu Cuenta de financiación para completar el proceso de recuperación de activos. <br>Si no es posible recuperar tus activos, o si el motivo del fallo del depósito no ha sido ningún error por tu parte, no se incurrirá en ningún gasto. Si estás de acuerdo con estas condiciones, haz clic en Confirmar y procederemos con tu solicitud.",
  "assetsBack.cs.airCoin.reason1": "<span>Si la red blockchain de la criptomoneda depositada no es compatible con {brandName}, o <span class='{style}'>si la cripto no figura o ha dejado de figurar en {brandName}</span>, el depósito no se abonará.</span>",
  "assetsBack.cs.airCoin.reason2": "<span>Por la seguridad de tus fondos, <span class='{style}'>solo podemos devolver tu depósito a la dirección blockchain original una vez que se apruebe, y se proporcionará el TxID del reembolso. Si tienes alguna circunstancia especial, contacta con nuestro servicio oficial de atención al cliente en support@kucoin.com.</span> Si la dirección de origen del depósito es otra plataforma, contacta con esta para conocer los siguientes pasos una vez finalizado el reembolso por nuestra parte.</span>",
  "assetsBack.cs.airCoin.title": "Depósitos realizados mediante cadenas no admitidas/monedas no incluidas",
  "assetsBack.cs.refundAddress.title": "Dirección de reembolso",
  "assetsBack.cs.refundAddress.title.warn": "Asegúrate de que la dirección de devolución coincide con la dirección de envío original.",
