  "assetsBack.feeStatus06": "Reembolsado",
  "assetsBack.form.errMsg5": "Formato no válido. Solo se admiten archivos {type}.",
  "assetsBack.form.tips1": "Por la seguridad de tus fondos, <span class='{style}'>solo podemos devolver los fondos depositados a la dirección del bloque de origen sin memos, etiquetas ni mensajes.</span> Si la dirección de origen del depósito pertenece a una plataforma, contacta con esta para obtener ayuda después de que KuCoin te devuelva los fondos. Si hay circunstancias especiales, contacta con nosotros a través de support@kucoin.com.",
  "assetsBack.form.tips2": "Nota: Para proteger tus activos, solo podemos devolver los fondos recuperados a la dirección de origen del depósito original (es decir, desde la que se enviaron en la blockchain). Para cualquier circunstancia especial, contacta con nuestro Servicio de atención al cliente en support@kucoin.com. Si la dirección de devolución es una dirección de monedero caliente que pertenece a otra plataforma, tendrás que contactar con esa plataforma para obtener asistencia adicional cuando se haya completado el reembolso por nuestra parte.",
  "assetsBack.form.tooltip1": "Selecciona la moneda depositada en el menú desplegable. Si no la ves, introdúcela manualmente.",
  "assetsBack.reason1": "Has olvidado especificar una Etiqueta/Memo al hacer el depósito o es errónea.",
  "assetsBack.reason1.confirmModelDes": "Confirma que los datos de tu solicitud son correctos. Una vez aprobada, te avisaremos para que pagues las comisiones correspondientes. Cuando la solicitud se complete, te proporcionaremos el TxID del depósito devuelto.",
  "assetsBack.reason1.des1": "Para ciertas criptomonedas como XLM, EOS y XRP, se debe rellenar una etiqueta o memo durante el proceso de depósito. Si no introduce correctamente tanto la dirección como la etiqueta, el depósito fallará.",
  "assetsBack.reason1.des2": "Por la seguridad de tus fondos, <span class='{style}'>solo podemos devolver los fondos depositados a la dirección del bloque de origen sin memos, etiquetas ni mensajes. Se proporcionará el TxID de los fondos devueltos.</span> Si la dirección de origen del depósito pertenece a otra plataforma, tendrás que contactar con ella para obtener más ayuda una vez que hayamos completado la devolución por nuestra parte. Si hay circunstancias especiales, contacta con nosotros a través de support@kucoin.com.",
  "assetsBack.reason1.des3": "Si has especificado accidentalmente una etiqueta o memo que pertenece a otro usuario, es posible que tus fondos se hayan depositado en su cuenta. En tales casos, lamentablemente, no podemos proporcionar más asistencia.",
