  "bJSGSzQJPofcxucs9NZe4P": "Prevista para finales de 2023 o principios de 2024, la <a href='{url}' target='_blank'>actualización de Ethereum Dencun</a> traerá mejoras de escalabilidad y nuevas funciones, basándose en el progreso de actualizaciones anteriores. Un componente clave de esta es EIP-4844, que introducirá \"blobs\", un nuevo tipo de transacción en la red Ethereum. Este desarrollo tiene como objetivo reducir drásticamente las comisiones de gas entre 10 y 100 veces, con mayor escalabilidad.",
