  "beginnerZone.rule.item1": "1. El evento comienza el {date} y tiene una duración limitada.",
  "beginnerZone.rule.item2": "2. Apúntate a una caja misteriosa y gana hasta {num1} USDT. Solo pueden participar los nuevos usuarios que se hayan registrado correctamente en {brandName} durante el evento. Tras hacerlo, reciben una oportunidad de ganar una caja misteriosa por valor de hasta {num2} USDT.",
  "beginnerZone.rule.item3": "3. Completa tu primer depósito/compra de cripto y gana hasta {num1} USDT. Solo son aptos los usuarios que nunca han depositado o comprado criptos en {brandName} antes del evento. Aquellos cuyo primer depósito/compra de criptos sea de {num2} USD o más (se admiten depósitos/compras de todos los tipos de criptodivisas, la cantidad se calculará según el precio de la cripto en el momento de depositar/comprar) podrán participar en la rifa para ganar una caja misteriosa por valor de hasta {num3} USDT.",
  "beginnerZone.rule.item4": "4. Los usuarios pueden depositar o comprar criptos a través de Operar rápido, P2P y pagos de terceros para completar la tarea. Los sobres rojos y los fondos de prueba no cuentan.",
  "beginnerZone.rule.item5": "5. Completa tu primera operación y gana hasta {num1} USD. Solo son aptos los usuarios que nunca han operado en {brandName} antes del evento. Aquellos cuya primera operación sea de {num2} USD o más durante este tendrán la oportunidad de ganar dos cajas misteriosas en la rifa por valor de hasta {num3} USD. El volumen de trading con una tasa de comisión de 0 no se contabiliza a efectos de este evento.",
  "beginnerZone.rule.item6": "6. Las operaciones válidas incluyen operaciones de futuros, operaciones de spot, compras de productos de {brandName} Earn, operaciones de bots de trading y operaciones de márgenes. Los valores se calculan en función del importe de la transacción en el momento de emitirse correctamente.",
  "beginnerZone.rule.item7": "7. Puede haber un retraso en la actualización de los datos. Si no actualizan, intenta refrescar la página o contacta con el Servicio de atención al cliente.",
  "beginnerZone.rule.item8": "8. Las recompensas suelen recibirse en un plazo de {num} días, pero pueden producirse retrasos. Al usar un cupón de reducción de fiat, se te reembolsará el importe deducido tras emitirse la orden.",
  "beginnerZone.rule.item9": "9. Las recompensas de las cajas misteriosas pueden incluir: monedas populares, fondos de prueba de futuros, bonificaciones de margen, cupones (de reducción de futuros, de aumento de tasa, de reducción de fiat, de reembolso de comisiones de trading y sin intereses), ¡y más!",
  "beginnerZone.rule.other": "Reglas adicionales",
  "beginnerZone.rule.other.item1": "1. Las recompensas deben reclamarse en un plazo de {num} días, o caducarán.",
  "beginnerZone.rule.other.item2": "2. Las subcuentas no participan en este evento. Los depósitos realizados a través de subcuentas no se contabilizarán.",
  "beginnerZone.rule.other.item3": "3. Los valores en USD de los depósitos y operaciones durante este evento se calculan utilizando tipos de cambio en tiempo real.",
  "beginnerZone.rule.other.item4": "4. {brandName} se reserva el derecho de descalificar y revocar las recompensas de cualquier participante que se descubra que participa en actividades fraudulentas o ilegales.",
  "beginnerZone.rule.other.item5": "5. {brandName} se reserva el derecho de cancelar este evento, modificarlo o cambiar sus reglas.",
  "beginnerZone.rule.other.item6": "6. Todos los participantes deben cumplir estrictamente las Condiciones de uso de {brandName}.",
