  "etf.action.redeem": "Rescatar",
  "etf.action.subscribe": "Suscribir",
  "etf.action.toTrade": "Operar",
  "etf.answer.five.content1": "i. Comisiones de trading: se cobrarán al comprar/vender los tókenes apalancados en el mercado de spot. El nivel de comisión es el mismo que el del trading de spot.",
  "etf.answer.five.content2": "ii. Comisión de suscripción: se aplica al suscribirse a un token apalancado. Actualmente, es del {feeRate} % de cada suscripción.",
  "etf.answer.five.content3": "iii. Comisión de rescate: se cobra al rescatar un token apalancado. Actualmente, es del {feeRate} % de cada reembolso.",
  "etf.answer.five.content4": "iv. Comisión de gestión: se cobra a las 07:45 (UTC+8) cada día y es un {managementFees} %. La comisión se incorpora al valor liquidativo de los tókenes apalancados y no afectará a tus tenencias. Como se carga a diario de forma automática, hay que tener precaución al mantener tókenes apalancados a largo plazo.",
  "etf.answer.five.tilte": "Las comisiones relacionadas con los tókenes apalancados de {brandName} son las siguientes:",
  "etf.answer.one": "Los tókenes apalancados de {brandName} son activos con los que se puede operar en el mercado de spot de {brandName} que aprovechan las ganancias yendo en largo/corto sobre el activo subyacente. Por ejemplo, cuando el precio de BTC aumenta en un 1 %, entonces BTC3L aumentará en un 3 % mientras que BTC3S bajará en un 3 %. A diferencia del trading de márgenes o el trading de futuros, la tenencia de los tókenes apalancados no requiere garantías ni mantenimiento de márgenes, y no existe ningún riesgo de liquidación. Sin embargo, puede haber una alta volatilidad en el precio de los tókenes apalancados, por lo tanto, sé prudente con tu inversión.",
  "etf.answer.six.content1": "i. En comparación con el mercado de spot, el mercado de los tókenes apalancados presenta mayores riesgos e incertidumbres. Poseer tókenes apalancados puede dar lugar a múltiples pérdidas y ganancias intradía.",
  "etf.answer.six.content2": "ii. El mecanismo de ajuste y las comisiones de gestión implican que, cuanto más tiempo tengas un token apalancado, más comisiones pagarás. Hay que tener precaución al mantener tókenes apalancados a largo plazo.",
  "etf.answer.step1.content": "Puedes operar con los tókenes apalancados en el mercado de spot de {brandName}. Ve a la página de los tókenes apalancados y busca los que prefieras. Haz clic en \"Trading\" para comprar o vender.",
  "etf.answer.step1.title": "i. El mercado de spot de {brandName} (recomendado)",
  "etf.answer.step2.content": "{brandName} procesa las solicitudes de suscripción y rescate a las {unifiedSubmissionTimePoints} cada día. Los precios de suscripción/reembolso se determinan por los resultados de ejecución, por lo que existen incertidumbres sobre el tiempo y el precio. Conviene ser prudente al invertir.",
  "etf.answer.step2.title": "ii. Suscripción/rescate",
  "etf.answer.three": "Debido al mecanismo de ajuste, los tókenes apalancados de {brandName} son buenas opciones para movimientos de mercado unilaterales, mientras que no son adecuados para mercados fluctuantes. Cuando hay una gran volatilidad, puede haber más pérdidas intradía. Por lo tanto, ten cuidado al invertir.",
  "etf.answer.two": "Cada token apalancado de {brandName} es una participación unitaria de un fondo apalancado. El gestor del fondo garantiza que su rentabilidad se base en un múltiplo específico del activo subyacente y que los traders puedan conseguir ese mismo número. Cuando la volatilidad del precio del lado opuesto supera el umbral, se utiliza un mecanismo de ajuste para cubrir los riesgos y controlar la pérdida neta.",
  "etf.apply.alert": "<div>El procesamiento diario se produce a las {unifiedSubmissionTimePoints}. Los precios de suscripción y rescate se basan en la última operación completada. </div><div>Para reducir cualquier riesgo o incertidumbre, recomendamos usar el trading de spot.</div> <div class='tip'>Ten en cuenta: al suscribirte o rescatar, los activos siempre se abonarán a la siguiente hora de procesamiento programada.</div>",
