  "f04f212c6c864000ab3f": "Realizamos copias de seguridad de los datos regularmente para garantizar una rápida recuperación en caso de pérdida o daño de los datos.",
  "f0c3a38dc9884000a01b": "Las nuevas monedas añadidas a KuCoin Ahorro tendrán Auto Earn activado.",
  "f13dde558c1e4000a40b": "Seguridad del sistema",
  "f28d189c4db14000a9ab": "Desarrollo seguro",
  "f2b84adc997e4000a9b4": "Nuestras reservas se distribuyen en monederos fríos, templados y calientes, y la mayoría de los activos se almacenan en monederos fríos a los que no se puede acceder directamente desde Internet, lo que minimiza el riesgo y protege los fondos de los usuarios.",
  "f2e4a9a1d64e4000a1a0": "Anterior:",
  "f3b1d516d30b4000abd0": "Contenido",
  "f3befe03e4364000a82e": "La Autenticación Multifactor (MFA) es una medida simple y efectiva que añade una capa extra de protección. Cuando se activa la MFA, realizas un segundo tipo de verificación además de introducir tu nombre de usuario y contraseña.\n\n{brandName} utiliza varios métodos de MFA, incluyendo códigos de verificación por correo electrónico, códigos de mensajes de texto y Google Authenticator. Además, nuestra aplicación ofrece opciones de autenticación biométrica, como reconocimiento de huellas dactilares y facial, para verificar tu identidad de manera rápida y segura.\n\nSi la seguridad del sistema detecta anomalías significativas en el dispositivo y la dirección IP utilizados para iniciar sesión en tu cuenta, o si considera que tu acción reciente puede suponer un riesgo para la seguridad de tu cuenta, se utilizarán enlaces de correo electrónico para reforzar aún más la verificación. Esto ayuda a prevenir violaciones de cuenta por ataques de phishing, fraudes de telecomunicaciones y diversas otras amenazas.",
  "f47b94ef147c4000a250": "Disponible + Invertido (USDT)",
  "f5B3R5EgXkkHdXBGHyJ8Rm": "Introduce el UID",
  "f5Zge54Cj2Ntd1RrAMMfCG": "La minería de criptomonedas es crucial para las redes blockchain y utiliza tanto hardware como software para resolver problemas matemáticos y recompensar a los mineros en criptomonedas. En esta guía, comprenderás los beneficios, riesgos, tipos y rentabilidad de la minería en la nube, además de cómo prevenir estafas.",
