  "f6c3cbe6a2ef4000a8f1": "1. El sistema te ayuda a suscribirse a productos de Ahorro para tus monedas seleccionadas con los saldos disponibles en tu cuenta de financiación. Ocurre diariamente a las 03:00 (UTC+2).",
  "f6fe83efb3fe4000a80e": "Una frase anti-phishing ayuda a prevenir ataques de phishing. Este código se puede configurar en tu correo electrónico, inicio de sesión y configuraciones de retirada. Al comprobar si el código se muestra durante el inicio de sesión, los usuarios pueden verificar si el sitio web es genuino o un sitio de phishing. Si se sospecha de un sitio de phishing, deberías salir de él inmediatamente y variar tus configuraciones de seguridad para mantener tu cuenta segura.",
  "f919f92814284000a58e": "Aislamiento de datos confidenciales con bases de datos dedicadas y contenedorización",
  "f9bea9fe0aa84000a87c": "Tasas de interés: {coin1} al {apr1}, {coin2} al {apr2}, y {coin3} al {apr3}.",
