  "goLJKkrkVr4mA3dyodh62A": "{brandName} solo recopilará la información sobre tu proyecto y equipo que sea estrictamente necesaria, y cumplirá escrupulosamente las leyes y normativas relativas al respecto. Dicha información solo se utilizará internamente por {brandName} con fines de revisión y aprobación del proyecto. {brandName} mantendrá toda la información del proyecto en la más absoluta confidencialidad, y no revelará, venderá o proporcionará ilegalmente dicha información a ninguna persona o entidad. {brandName} tampoco manipulará, modificará o destruirá dicha información sin autorización. A menos que cuente con permiso de los propietarios o se sigan los debidos procesos legales, {brandName} no proporcionará ni revelará información sobre tu proyecto a terceros.",
