  "hHRbFLLmCUKLuEmuoGWGwn": "Cerrar posiciones",
  "hK852hz7hizKfY18GJ24zb": "Se ha producido un retroceso de la blockchain. Se deben importes de forma temporal debido a que los depósitos anteriores de tu cuenta se han visto afectados. Te hemos enviado un correo electrónico con los detalles. Una vez que tus depósitos se reconfirmen, el saldo de tu cuenta se actualizará y se restablecerá. Para más información, consulta <a href='{supportLink}'>Ayuda sobre retrocesos de la blockchain</a>.",
  "hKab9KomDpTJC5QPiPxAYq": "Los monederos Web3 permiten stakear criptos directamente dentro de la interfaz del monedero, lo cual contribuye al consenso y la seguridad de las redes blockchain soportadas, como las PoS. Al stakear tus activos, puedes obtener ingresos pasivos en forma de recompensas de stake, que se distribuyen por participar y apoyar las operaciones y la seguridad de la red.",
  "hPpXbTGatjRLNMWW2ygf3Y": "<span>Acceso a servicios DeFi:</span> los usuarios pueden participar en actividades DeFi como <a href='{url}' target='_blank'>préstamos</a>, tomar prestado, <a href='{stakurl}' target='_blank'>stake</a>, <a href='{farmurl}' target='_blank'>yield farming</a> y pools de liquidez.",
  "hSei7Tvhmqoj4TeLMaGssc": "El copy trading es una estrategia que permite a los traders principiantes replicar automáticamente las operaciones de los traders experimentados, lo que les permite participar en el mercado y aprender de los expertos. Puede ser un enfoque que ahorra tiempo y diversifica el riesgo, pues ayuda a reducir las operaciones emocionales, obtener orientación estratégica de los expertos y, potencialmente, generar ingresos pasivos.",
  "hTxHSLVYUGZZBZ3X5r5oiN": "Tómate un minuto para comprender los riesgos del trading de tókenes apalancados: una pequeña inversión de tiempo para una experiencia de trading más fluida.",
