  "prxjHPGphvoSWB1ECo7XcB": "La volatilidad de las criptos significa que los mercados pueden cambiar rápido, y copiar una estrategia que no se adapte podría resultar en pérdidas significativas. Por ejemplo, Alice, una nueva inversora, copia la estrategia de Bob, un trader experimentado, para vender Bitcoin a 30 000 $. Sin embargo, un repentino giro alcista lleva el precio de <a href='{url}' target='_blank' >Bitcoin</a> a 35 000 $. Cuando esto ocurre, Bob minimiza las pérdidas mediante una gestión temprana del riesgo, mientras que Alice puede enfrentarse a mayores riesgos de liquidación por entrar en el mercado más tarde.",
