  "pzqPBTTuRx3rzsz61PfJh1": "Los activos rescatados se depositarán en tu Cuenta de financiación.",
  "q1PW9RkfmqxFDXqywnVciR": "¡Pero eso no es todo! Una vez completada, Ethereum 2.0 hará que la blockchain Ethereum sea mucho más escalable, eficiente y rentable. Se necesita tiempo para crear cosas buenas, y la Fundación Ethereum ha dividido esta importante evolución en múltiples fases, cada una de las cuales implementa un cambio importante en la blockchain Ethereum.",
  "q2PuzNWLvYraYkDEDdWQ4q": "Por ejemplo, en un pool de minería de Bitcoin, los mineros colaboran poniendo en común sus recursos computacionales para aumentar sus posibilidades de minar bloques de <a href='{url}'  target='_blank'>Bitcoin</a> con éxito y obtener recompensas.",
  "q4FUiCm1cs2CSZxbLKmqCD": "Bonificación para recién llegados: ¡hasta <span>8200 USDT</span> en recompensas!",
