  "rHQD7FryNSdVCeUDJ2x8Ff": "UID",
  "rKrtBdxk8yCqGm8YYqKMiS": "Días que faltan para el próximo halving",
  "rLB15qJGkhutW4aDSzPJs7": "El exchange reconoce los activos depositados una vez que cumplen el recuento de confirmaciones de bloque requerido, y solo entonces pueden retirarse.",
