  "aboutus.roadmap.2023.q3": "<p>{brandName} lanza <b>Trading de premercado</b>, el primer producto OTC de la industria</p><p>{brandName} lanza <b>Grid de Margen</b>, una nueva estrategia de bot de trading de márgenes</p>",
