  "aboutus.roadmap.2024.q1": "<p><b>KuCard x Apple Pay</b>: La tarjeta cripto Visa de {brandName} ahora es compatible con Apple Pay</p><p><b>Liderazgo Regulatorio en India</b>: {brandName} es pionera en el cumplimiento de FIU entre los exchanges de criptomonedas globales</p><p>{brandName} lanza <b>Futures Martingale</b>, una nueva estrategia de bot de trading de futuros</p>",
  "aboutus.roadmap.2024.q2": "<p>{brandName} lanza GemSlot y GemPool para listados de tókenes</p><p>{brandName} presenta <b>Tendencia de futuros de IA</b>, una nueva estrategia de bot de trading de futuros</p><p>{brandName} Futures introduce órdenes de límite avanzadas, otorgando a los usuarios una mayor flexibilidad de trading</p>",
  "aboutus.roadmap.2024.q3": "<p>{brandName} celebra 7 años: \"7rust {brandName}, Sé Dueño de Tu Futuro\"</p><p>{brandName} Futures introduce <b>Margen Cruzado</b>, mejorando la eficiencia del capital</p><p><b>Auto-Earn</b>: Una función para suscribir fácilmente fondos inactivos a Ahorros Flexibles para obtener rendimientos estables</p><p><b>Smart Earn</b>: Una herramienta de {brandName} Earn que ofrece recomendaciones personalizadas basadas en preferencias y niveles de riesgo</p><p><b>Actualizaciones del Bot de Trading</b>: Una interfaz de usuario renovada y nuevos modos de bot de trading, con 12 estrategias automatizadas para diversas condiciones de mercado</p><p></p>",
  "aboutus.roadmap.2024.q4": "<p>{brandName} lanza <b>Trading de opciones</b>, ampliando las estrategias de trading y herramientas de gestión de riesgos</p><p>{brandName} lanza <b>Ventajas de futuros</b>, una interfaz dedicada con promociones exclusivas para traders de futuros</p><p>{brandName} lanza <b>Copy Trading de futuros</b>, permitiendo la duplicación de estrategias en tiempo real al integrar las operaciones del trader líder</p><p><b>Flash de Noticias</b>: Un feed de noticias impulsado por IA para obtener perspectivas de mercado más inteligentes</p><p><b>{brandName} Research</b>: Un nuevo centro de recursos para análisis de la industria e informes de proyectos</p><p><b>{brandName} Aprende y Gana</b>: Una forma interactiva de ganar criptomonedas gratis a través del aprendizaje</p>",
  "aboutus.roadmap.2025.q1": "<p><b>{brandName} Pay</b>: Una solución para comerciantes para pagos cripto sin problemas</p><p><b>{brandName} Noticias</b>: Actualizaciones del mercado en tiempo real sobre Bitcoin, altcoins y desarrollos de Web3</p>",
