  "23a3d14b6cf34000a882": "Comunícate con nosotros.",
  "24e8b825a97b4000a553": "Nuestras ventajas",
  "288ee3f258534000a134": "KuCoin Ventures invierte en y apoya proyectos innovadores de la blockchain en sectores como infraestructura, DeFi, NFTs y SocialFi, impulsando el crecimiento continuo del ecosistema Web3.",
  "2bc2d33b535b4000ac09": "Evolucionamos continuamente para satisfacer las necesidades de los comerciantes modernos, ofreciendo herramientas de vanguardia y una experiencia de trading sin fisuras.",
  "2ecd9e9b835f4000af50": "Infraestructura de interoperabilidad Web3",
  "3a1d43481cdb4000a587": "Correo electrónico",
  "3ccc4f64a7ab4000a0e2": "Como inversor centrado en la comunidad y orientado a la investigación, KuCoin Ventures colabora estrechamente con sus proyectos de cartera a lo largo de todo su ciclo de vida, especializándose en DeFi, GameFi e infraestructura Web3.",
