  "67f9cb69ac0e4000a169": "Únete a KuCoin y sé parte de un futuro construido sobre la transparencia, la integridad y la pasión.",
  "6a1ac3fe9f8f4000ab62": "Convertirnos en una empresa tecnológica respetada en todo el mundo, impulsora de la innovación en el sector de las criptomonedas.",
  "6ea33259dec64000a53d": "Sistemas sociales Web3",
  "7524379504f44000ac34": "Facilitando el <span class='hl-text'>libre flujo <br/>de valor digital a nivel mundial</span>",
  "7762b1cabbcf4000a1cd": "Tu seguridad es nuestra máxima prioridad. Protegemos tus activos con una protección líder en la industria, garantizando una total tranquilidad.",
  "7b43d074282b4000a338": "Todo comenzó con Michael, un programador apasionado que empezó a programar con solo 8 años y lanzó su primera startup a los 16. En 2012, descubrió el bitcoin a través de su jefe, Eric, y ambos se sumergieron de lleno en el mundo de la minería. Sin embargo, cuando Michael intentó vender algunos BTC en Mt. Gox, el exchange más grande de la época, se dio cuenta rápidamente de lo difícil e inaccesible que era el trading de criptomonedas para los recién llegados, a pesar de su inmenso potencial para transformar el panorama financiero.",
  "7d7838da36ea4000a98c": "Tienda de aplicaciones de criptomonedas multicadena Web3",
  "7fa0d0df97424000a257": "La blockchain optimizada para los jugadores",
  "86f4b83859364000aaa7": "Aplicación SocialFi",
  "8891a013712e4000a472": "A medida que la adopción de la blockchain se aceleraba, Michael y Eric vieron su poder transformador, no solo para los ricos, sino para todos, incluidos los no bancarizados y desatendidos. A finales de 2013, se sentaron en un café y escribieron las primeras líneas de código de lo que se convertiría en KuCoin, el Exchange del Pueblo, una plataforma diseñada para derribar barreras y hacer que las criptomonedas sean accesibles para todos.",
  "8eb597d442274000a1ee": "Mercado monetario del ecosistema SUI",
  "931d0a8829fa4000aab0": "Acelerar la adopción de la blockchain y la criptomoneda permitiendo el libre flujo de valor digital en todo el mundo.",
  "9adf29707ebc4000a467": "Misión",
  "a23f71374c5e4000a362": "El brazo de inversión líder de KuCoin Exchange",
  "a4d0df02a97f4000a741": "Exchange de rendimiento sintético apalancado",
  "b64124e449ee4000a742": "Editor y desarrollador de juegos multiplataforma play-and-earn",
  "b84161bcdd5e4000a70b": "Nuestra historia",
  "babf517cd7614000a650": "KuCoin Ventures se asocia con fondos de inversión líderes para apoyar proyectos innovadores de la blockchain, fomentando el crecimiento en el ecosistema cripto y Web3.",
  "c10b4e0fdd304000ab1d": "Empoderando <span class=\"web3\">Web3</span> y <span class=\"tech\">Tecnología de Próxima Generación</span>",
  "c25f2a1fc8ad4000a4ed": "Un fondo de capital especializado en inversiones en criptomonedas en etapa inicial a nivel mundial.",
  "c44b0e64e2ac4000a85b": "Protocolo de liquidez descentralizada en SUI",
  "c979d478b8ab4000a0c8": "Empoderamiento Global",
  "d637b3a566894000a742": "Fondos de capital",
  "d7bcc8e004234000ac88": "Red descentralizada ZK-RaaS",
  "e0bdc1ffdeaf4000aed7": "KuCoin fue fundada por dos entusiastas de la tecnología que, con la visión de hacer que la criptomoneda sea accesible para todos, vieron el potencial de la blockchain desde el principio.",
  "e2fd47cd88394000a1c3": "Solicitar ahora",
