  "f0f30111507d4000aa73": "Nuestro portafolio",
  "f273ff4318a74000ac49": "KuCoin Ventures está comprometido a invertir en los proyectos de criptomonedas y blockchain más inovadores que están dando forma a la era Web3.",
  "f44dd159465f4000a8c0": "El NFT blue-chip más aclamado",
  "f4857287756d4000affb": "KuCoin es un exchange de criptomonedas líder a nivel global, confiado por más de 40 millones de usuarios en más de 200 países. Ofrecemos trading de spot, de margen, de opciones, de futuros y perpetuos, junto con servicios de DeFi, préstamo y minería.",
